import React from "react";
import {
  Link,
  NavLink
} from "react-router-dom";

export default function Header() {
  console.log("header");
  return (
      <div>
        <ul className="nav">
          <li>
            <NavLink to='/' activeStyle={{ color: 'teal' }}>Home</NavLink>
          </li>
          <li>
            <NavLink to='/contact'activeStyle={{ color: 'teal' }}>Contact Me</NavLink>
          </li>
        </ul>
      </div>
  );
}

//code used from https://reactrouter.com/web/example/basic
